    <div className="container mt 3" >
        <div className="row">
            <div className="col-md-5">
                <Signup />                
            </div>
            <div className="col-md-7">
                <img src="https://images.unsplash.com/photo-1516321318423-f06f85e504b3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NXx8c2VydmljZXN8ZW58MHx8MHx8&w=1000&q=80" alt=""/>
            </div>
        </div>
    </div>
  );
}

export default App;
